import React from 'react';
import { StyleSheet, View } from 'react-native';
import Header from './components/header';

export default function App() {
  return (
    <View style={styles.header}>
      <Header />
      <View></View>      
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    flex: 1,
  },
});
